    analyticsEvent(event) {
        window.ga('send', 'event', event, '', {
            hitCallback: () => {
                console.log('Tracking ' + event + ' successful');
            }
        });
        // gtag app + web
        window.gtag('event', event, {
            event_callback: () => {
                console.log('Tracking gtag ' + event + ' successful');
            }
        });
    }
